import React from 'react'

import { categories } from "../utils/constants";

const Category = () => {
  return (
    <nav>
        <ul>
            {categories.map((category) => (
                <li>
                    <a href="/">{category.name}</a>
                </li>
            ))}
        </ul>
    </nav>
  )
}

export default Category
